import React, {Fragment} from "react";

const createEvent = () => {
  return <Fragment>
    <h1 className="text-center mt-5 ">Event Management Dashboard</h1>
    <form>
      <input type = "text" className="form-control"/>
      <button className="">Create Event</button>
    </form>
  </Fragment>;
};

export default createEvent;
